import React from "react";
import "./CardInfo.css";

export default function CardInfo({
  header,
  text,
  link,
  extraClass,
  className
}) {
  return (
    <div className={`${extraClass} ${className}`}>
      <h2 className="CardInfoHeader">{header}</h2>
      <p className="CardInfoText">
        {text}
        {"\n"}
        {link}
      </p>
    </div>
  );
}
